import './App.css';
import Header from "./compo/Header";
import Nav from "./compo/Nav";


function App() {
  return (
    <div className="grid">
        <Header/>
        <Nav/>
        <div className="content">
            <div>
                <img src={"https://flytothesky.ru/wp-content/uploads/2012/10/midnight-sun-in-lofoten-norway.jpg"}/>
            </div>
            <div>
                ava + desc
            </div>
            <div>
                My Post
                <div>New post</div>
            </div>
            <div>
                Post 1
            </div>
            <div>
                Post 2
            </div>
        </div>
    </div>
  );
}

export default App;
